/** Click-Action fuer summary-Elemente (Nur beim aufklappen) **/
try{
	window.setTimeout(
	  function(){
			$("summary[role='button']").click(function(){
				var dcas= $(this).attr('data-click-action');
				var isOpen= $(this).attr('aria-expanded');
				
				if(isOpen !== null && isOpen === "true" && dcas !== null){		
					if(wt != null && typeof(wt) == "object" && typeof(wt.sendinfo) == "function"){
						var config = wt.getConfig(true);
						var actionName  = dcas;		
						config.linkId = actionName;
						wt.sendinfo(config, actionName, "link");			
					}
				}	
			});	  
	  }, 1000 
	);
} catch(ex){ }
